import Vue from 'vue'
import App from './App.vue'
import VueRouter from 'vue-router'
import HandGestures from './HandGestures.vue'

Vue.use(VueRouter)

const routes = [
  { path: '/', component: { template: '<div>หน้าแปลภาษามือ</div>' } }, // จะเอาเนื้อหาใส่ router-view
  { path: '/gestures', component: HandGestures }
]

const router = new VueRouter({
  mode: 'history',
  routes
})

new Vue({
  router,
  render: h => h(App)
}).$mount('#app')
